spec:
  apiservicedefinitions: {}
  customresourcedefinitions:
    owned:
    - kind: Annotationlab
      name: annotationlabs.apps.johnsnowlabs.com
      version: v1
  description: |
    NLP Lab is a data labeling and annotation tool that helps you
    label different types of data using a simple interface with a standardized output
    format.

    It contains enterprise features like Project Management and sharing, SSO
    integration, OpenAPI Specification 3.0 compliant API, task management, and active
    learning/preannotation using Spark NLP.

    Furthermore, the production deployment of the application is done using a helm chart.
    The same helm chart is also used to create an AWS AMI for an EC2 based single server 
    deployment using packer.

    Make sure you have defined shared storage such as efs/nfs/cephfs prior to installing the NLP Lab Operator.
    Update the host property in the YAML configuration to define the required domain name to use instead of the 
    default hostname annotationlab.

    NLP Lab Operator Installtion guide [NLP Lab Operator][]:
    [NLP Lab Operator]: https://nlp.johnsnowlabs.com/docs/en/alab/install    
